import { StyledToDoListItem } from "./StyledToDoListItem"

export default function ToDoListItem({ object }) {
  return (
    <StyledToDoListItem>
      <div className="card">
        <div className="card-body">
          <h3 className="card-title">{object.title}</h3>
        </div>
      </div>
    </StyledToDoListItem>
  )
}
